export const fetchContributionData = async (org, repo, user) => {
    try {
        const response = await fetch(`/api/contributions?org=${org}&repo=${repo}&user=${user}`);
        if (!response.ok) {
            throw new Error("Failed to fetch data");
        }
        return await response.json();
    } catch (error) {
        console.error("Error fetching data:", error);
        return [];
    }
};
